import React from 'react'
import logo from './CampusMap.png'
import './CampusMap.css'

function CampusMap() {
  return (
    <div
   
     className='img'>
        <img 
         style={{
          width:"70%",
          height: "70%"
        }}
        src={logo} alt="Logo" />
        
    </div>

 

  )
}

export default CampusMap
